import express from 'express';
import morgan from 'morgan';
import cors from 'cors';
import path from 'path';
import exphbs from 'express-handlebars';
import methodOverride from 'method-override';
import session from 'express-session';

import reguistrosRoutes from '../routes/reguistros.routes';
import statusRutes from '../routes/status.routes';


const app = express();

//Setings
app.set('port', process.env.PORT || 8080);
app.set('views', path.join(__dirname, 'views'));
app.engine('.hbs', exphbs({
    defaultLayout: 'main' ,
    layoutsDir: path.join(app.get('views'), 'layouts') ,
    partialsDir: path.join(app.get('views'), 'partials'),
    extname: '.htb'
}));

app.set('view engine', '.hbs');

//Midelware
const corsOptions = {};
app.use(cors({corsOptions}));
app.use(morgan('dev'));
app.use(express.json());
app.use(express.urlencoded({extended: false}));
app.use(methodOverride('_method'));
app.use(session({
    secret: 'secretA',
    resave: true,
    saveUninitialized: true
}))

//Routes
app.get('/', (req, res) => {
    res.send('hello world');
});

app.use('/api/Reguistros', reguistrosRoutes);
app.use('/api/Status', statusRutes);

// Fer una ruta que contingi un ranking contes de instagram.

export default app;

